import { Text } from '@0xsequence/design-system'
import React from 'react'

import type { LogoProps } from '../../types.js'

interface GetGuestLogo {
  isDarkMode: boolean
  isTextDisplayed: boolean
}

export const getGuestLogo = ({ isDarkMode, isTextDisplayed }: GetGuestLogo) => {
  const fillColor = isDarkMode ? 'white' : 'black'

  const GuestLogo: React.FunctionComponent = (props: LogoProps) => {
    return (
      <span className="flex flex-col items-center">
        <img src={image} alt="" {...props} />
        {isTextDisplayed && (
          <Text variant="xsmall" color={fillColor}>
            Guest
          </Text>
        )}
      </span>
    )
  }
  return GuestLogo
}

const image =
  'data:image/png;base64,'
